import React from 'react';
import Cards from './Cards';

const CardsList = ({ people }) => {

	const peo = (cha) => {
		return(
			people && 
				people.map((person, i) => {
					return(people[i])	
			})
		);
	}

	return(
		<div>
			{ people && <Cards person = { peo(people) }/> }			
		</div>
	)
}

export default CardsList;
